import React from "react";

function Navbar(props) {
  console.log(props.groceries);
  return (
    <ul className="list-group">
      {props.groceries.map((item) => {
        const itemIndex = props.groceries.indexOf(item);
        return (
          <li className="list-group-item" key={props.groceries.id}>
            {`${props.groceries[itemIndex].name}`}
          </li>
        );
      })}
    </ul>
  );
}

export default Navbar;
